import "./Header.css";
import { ArrowLeftOutlined, HomeFilled } from "@ant-design/icons";

function Header() {
    return (
        <>
            <div className="container-header">
                <div className="header">
                    <div id="arrowIcon"><ArrowLeftOutlined /></div>
                    <div id="homeIcon"><HomeFilled /></div>
                </div>
            </div>


        </>
    );
}

export default Header;
